const get_after_trading = async (date_now) => {
    let result
    try {
        const date_now_twse = date_now.replace(/-/g, '')
        const response = await fetch(`https://www.twse.com.tw/exchangeReport/MI_INDEX?response=json&date=${date_now_twse}&type=ALLBUT0999`, {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json',
            }
        });
        const j = await response.json();
        if (!j.data9) {
            return []
        }

        result = j.data9
        //櫃買收盤價
        const date_now2 = encodeURIComponent(`${date_now_twse.substring(0, 4)-1911}/${date_now_twse.substring(4, 6)}/${date_now_twse.substring(6, 8)}`)
        var options = {
            'muteHttpExceptions': true,
            'timeout': 60 * 1000, // 设置超时时间为60秒
        };
        // const response2 = UrlFetchApp.fetch(`https://www.tpex.org.tw/web/stock/aftertrading/otc_quotes_no1430/stk_wn1430_result.php?l=zh-tw&d=${date_now2}&se=EW`, options);
        // const j1 = JSON.parse(response2.getContentText())
        const response2 = await fetch(`https://www.tpex.org.tw/web/stock/aftertrading/otc_quotes_no1430/stk_wn1430_result.php?l=zh-tw&d=${date_now2}&se=EW`, {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json',
            }
        });
        const j1 = await response2.json();
        
        if (!j1.aaData || j1.aaData.length == 0) {
            return []
        }
        const j2 = (j1.aaData || []).map(v => {
            const changeSign = v[3] > 0 ? '+' : v[3] < 0 ? '-' : '';
            const absoluteChange = Math.abs(parseFloat(v[3]));

            return [
                v[0], // 證券代號
                v[1], // 證券名稱
                v[7], // 成交股數
                v[9], // 成交筆數
                v[8], // 成交金額
                v[4], // 開盤價
                v[5], // 最高價
                v[6], // 最低價
                v[2], // 收盤價
                changeSign, // 漲跌(+/-)
                absoluteChange, // 漲跌價差
                v[10], // 最後揭示買價
                v[11], // 最後揭示買量
                v[12], // 最後揭示賣價
                v[13], // 最後揭示賣量
                "" // 本益比 (not present in the provided data)
            ]
        })

        const result_20 = result.concat(j2).map(v => {
            return [
                v[0], v[8]
            ]
        })
        return result_20

    } catch (err) {
        console.error(err)
        return []
    }

}

//指定兩個日期的收盤價
const date_now = '2024-07-11'
const date_yesterday = '2024-06-11'

const right_data = await get_after_trading(date_now);
const left_data = await get_after_trading(date_yesterday);

//for rigght_data 然後找到left_data相同股票代號的資料，計算出漲跌幅，並且將資料放入right_data
function get_change_rate(right_data, left_data){
    for(var i=0; i<right_data.length; i++){
        for(var j=0; j<left_data.length; j++){
            if(right_data[i][0] == left_data[j][0]){
                //計算漲跌幅
                const percentage = (Number(right_data[i][1]) / Number(left_data[j][1]) - 1) * 100;
                right_data[i].push(left_data[j][1]);
                right_data[i].push(Math.round(percentage*100)/100);
            }
        }
    }
    return right_data;
}
const new_right_data = get_change_rate(right_data, left_data)
//由大到小排序?[3]
new_right_data.sort(function(a,b){
    if (isNaN(a[3])) a[3] = 0
    if (isNaN(b[3])) b[3] = 0
    return b[3]-a[3];
});

